import React from "react";
import styles from "./Hero.module.css";
import men from "../../assets/images/logo1.jpg";
import gif from "../../assets/images/258.gif";

const Hero = () => {
  return (
    <section className={styles.hero}>
      <div className={styles.container}>
        <div className={styles.text}>
          <h1 className={styles.typingHeading}>
            We create engaging web experiences
            <span className={styles.cursor}></span>
          </h1>
          <p className={styles.subheading}>
            Your one-stop destination for amazing web experiences. <br />
            We specialize in building responsive, scalable, and user-focused websites. <br />
            Driven by innovation, powered by precision. <br />
            Let’s shape the future of the web—together.
          </p>
          <a href="#projects" className={styles.cta}>
            See Projects
          </a>
        </div>

        <div className={styles.image}>
          <img src={men} alt="Developer character" className={styles.logo} />
          <img src={gif} alt="Animated GIF" className={styles.gif} />
        </div>
      </div>
    </section>
  );
};

export default Hero;
